TITLE:
  - 'simple test case for monolithic scalar-structure interaction involving electrochemistry and electrode-electrolyte
    interface coupling as well as volumetric change of anode and cathode due to change of lithium concentration:'
  - '- homogeneous Neumann boundary conditions for entire concentration field'
  - '- concentration in electrolyte held constant by Dirichlet volume condition'
  - '- Dirichlet boundary condition for potential at anode-side current collector'
  - '- Neumann boundary condition for potential at cathode-side current collector'
  - '- charge from fully discharged state with 1 C'
  - '- Butler-Volmer charge transfer kinetics at electrode-electrolyte interfaces'
  - '- Dirichlet boundary conditions are applied to the lateral structural surfaces and the master side
    of the current collector - active material interfaces'
  - '- anode uses growth law "MAT_InelasticDefgradLinScalarAniso" (strains in axial direction develop)
    and "MAT_InelasticDefgradLinTempIso" (isotropic strains develop)'
  - '- cathode uses growth law "MAT_InelasticDefgradLinScalarIso" (isotropic strains develop) and "MAT_InelasticDefgradLinTempIso"
    (isotropic strains develop)'
  - '- Adiabatic system'
  - '- Generation of heat due to internal resistances'
  - '- 5079 tet4 elements with matching interface nodes'
  - '- used unit system is: mm, microg, nmol, ms, K, microA'
